import React from "react";
import { Carousel, Image } from "react-bootstrap/";
import "bootstrap/dist/css/bootstrap.min.css";

const Poto = (props) => {
  return (
    <Carousel.Item style={{}}>
      <img
        className="w-100 d-block active"
        style={{
          minHeight: "300px",
          maxHeight: "300px",
          width: "100%",
          padding: "200px",
        }}
        src="image/1.jpg"
        alt="first side"
        fluid="true"
      />
      <Carousel.Caption style={{ color: "red" }}>
        <h1>this is the captionof the first slide</h1>
      </Carousel.Caption>
    </Carousel.Item>
  );
};

export default Poto;
